import React from 'react';
import {Menu} from "antd";

import './layout.css'

export const NavBarNotLogged = () => {
    return (
        <Menu
            className="menu"
            theme="light"
            mode="horizontal"
        >
            <Menu.Item className={"home-page"}>
                Home Page
            </Menu.Item>
            <Menu.Item className={"login"}>
                Login
            </Menu.Item>
            <Menu.Item className={"sign-up"}>
                Sign-Up
            </Menu.Item>
        </Menu>
    );
};
